import React from "react";
import { Link } from "react-router-dom";

function DeckList() {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Rendering in React</h5>
        <p>3 cards</p>
        <p className="card-text">
          React's component structure allows for quickly building a complex web
          application that relies on DOM manipulation.
        </p>

        <Link to="/" className="btn btn-secondary">
          View
        </Link>
        <Link href="/" className="btn btn-primary">
          Study
        </Link>
        <Link href="/" className="btn btn-danger">
          Delete
        </Link>
      </div>
    </div>
  );
}

export default DeckList;
